import React from 'react';
import Navbar from '../../components/Navbar';
import landing from '../../assets/landing.jpg';
import styles from './Landing.module.css';

function Landing() {
  return (
    <div>
      {/* Navbar */}
      <Navbar>
        <div className={styles.logoWrapper}>
          <h4 className={styles.taskTrackerText}>TaskTracker</h4>
        </div>
      </Navbar>

      {/* Landing Page Content */}
      <div className={styles.landing__wrapper}>
        <div className={styles.landing__text}>
          <h1>
            Agende suas tarefas di√°rias com o{' '}
            <span className="primaryText">TaskTracker!</span>
          </h1>
          <div className="btnWrapper">
            <Link to="/register" className="primaryBtn">
              Register
            </Link>
            <Link to="/login" className="secondaryBtn">
              Login
            </Link>
          </div>
        </div>

        <div className={styles.landing__img}>
          <img src={landing} alt="landing" />
        </div>
      </div>
    </div>
  );
}

export default Landing;
